B.Ee=new A.an(10,{id:2,title:"Membaca surat Al-Falaq",texts:B.Bk,is_day:!0,is_night:!0,surah:" (QS. Al Falaq: 1-5)",suggestion:"(Dibaca 3x)",faedah:u.G,description:"\u201cDengan menyebut nama Allah Yang Maha Pengasih lagi Maha Penyayang. Katakanlah: Aku berlindung kepada Rabb yang menguasai Shubuh, dari kejahatan makhluk-Nya, dan dari kejahatan malam apabila telah gelap gulita, dan dari kejahatan-kejahatan wanita tukang sihir yang menghembus pada buhul-buhul, dan dari kejahatan orang yang dengki apabila ia dengki\u201d",source:u.Z},B.m9,t.M)
