B.EO=new A.an(8,{id:7,texts:B.Ci,is_day:!0,is_night:!1,suggestion:"(Dibaca 4x)",faedah:" Barangsiapa yang mengucapkan dzikir ini ketika pagi dan petang hari sebanyak empat kali, maka Allah akan membebaskan dirinya dari siksa neraka.",description:"\u201cYa Allah, sesungguhnya aku di waktu pagi ini mempersaksikan Engkau, malaikat yang memikul \u2018Arys-Mu, malaikat-malaikat dan seluruh makhluk-Mu, bahwa sesungguhnya Engkau adalah Allah, tiada ilah yang berhak disembah kecuali Engkau semata, tiada sekutu bagi-Mu dan sesungguhnya Muhammad adalah hamba dan utusan-Mu.\u201d",source:"HR. Abu Daud no. 5069. Al Hafizh Abu Thohir mengatakan bahwa hadits ini hasan."},B.dC,t.M)
