B.EM=new A.an(8,{id:15,texts:B.By,is_day:!0,is_night:!0,suggestion:"(Dibaca 100x dalam sehari)",faedah:"Barangsiapa yang mengucapkan dzikir tersebut dalam sehari sebanyak 100 x, maka itu seperti membebaskan 10 orang budak, dicatat baginya 100 kebaikan, dihapus baginya 100 kesalahan, dirinya akan terjaga dari gangguan setan dari pagi hingga petang hari, dan tidak ada seorang pun yang lebih baik dari yang ia lakukan kecuali oleh orang yang mengamalkan lebih dari itu",description:"\u201cTidak ada ilah yang berhak disembah selain Allah semata, tidak ada sekutu bagi-Nya. Milik Allah kerajaan dan segala pujian. Dia-lah yang berkuasa atas segala sesuatu.\u201d",source:"HR. An Nasai Al Kubra 6: 10."},B.dC,t.M)
